import {CommonModule} from "@angular/common";
import {NgModule} from "@angular/core";
import {CandidatesComponent} from "./candidates.component";
import {CandidatesRoutingModule} from "./candidates-routing.module";
import {StoreModule} from "@ngrx/store";
import {candidateFeatureKey, candidateReducer} from "./store/candidates.reducer";

@NgModule({
  imports: [CommonModule, CandidatesRoutingModule, StoreModule.forFeature(candidateFeatureKey, candidateReducer)],
  declarations: [CandidatesComponent],
  exports: [CandidatesComponent],
})
export class CandidatesModule {}
